import Tasks from "./Tasks"

const Task = ( {tasks, onDelete}) => {


  return (
    <div>
      {tasks.map((task) => (
        <Tasks key={task.id} task = {task}
        onDelete={onDelete} />
      ))}
    </div>
  )
}

export default Task
